let payeesDAO = {
  get: id => {
    let tmpPayee = payeesData.find( payee => payee.id === id );
    return tmpPayee;
  },

  size: () => payeesData.length,

  list: () => [ ...payeesData ]
};

let accountsDAO = {
  get: id => {
    let tmpAccount = accountsData.find( account => account.id === id );
    return tmpAccount;
  },

  size: () => accountsData.length,

  list: ( criteria ) => {
    let accounts = _filter( accountsData, criteria );

    return [ ...accounts ];
  }
};

let peopleDAO = {
  get: id => peopleData.find( person => person.id === Number( id ) ),

  size: () => peopleData.length,

  list: () => [ ...peopleData ]
};

let categoriesDAO = {
  get: id => categoriesData.find( category => category.id === Number( id ) ),

  size: () => categoriesData.length,

  list: () => [ ...categoriesData ]
};

let txDAO = {
  get: id => {
    let tmpTx = txData.find( tx => tx.id === Number( id ) );
    return tmpTx;
  },

  list: ( criteria ) => {
    let tx;
    if ( criteria ) {
      tx = _filter( txData, criteria );
    } else {
      tx = txData.slice( 0, 101 );
    }

    return [ ...tx ];
  },

  size: () => txData.length,

  update: tx => {
    let pos = -1;
    let toBeUpdated = txData.find( ( tx, idx ) => {
      pos = idx;
      return tx.id === Number( id );
    } );
    let updated = Object.assign( {}, toBeUpdated, tx );

    // Make sure the id never changes
    updated.id = toBeUpdated.id;
    txData[ pos ] = updated;
  }

};

module.exports = { categoriesDAO, staticData, accountsDAO, peopleDAO, payeesDAO, txDAO };
